const axios = require('axios').default;

var allPlayers;

axios.get('https://www.balldontlie.io/api/v1/players')
  .then(function (response) {
    var players = response.data;
    console.log(players);
  })
  .catch(function (error) {
    console.log(error);
  })
  .then(function () {
  });
